import { VideosBody } from '../Helper/VideosBody';
import HoverVideoPlayer from 'react-hover-video-player';
import styles from './Videos.module.css'

const Videos = () => {
    console.log(VideosBody)
    return (
        <div className={styles.videoCont}>
            <HoverVideoPlayer 
                {...VideosBody.map(vids => {
                    return (<video className={styles.vid} key={vids.id} alt={vids.name} >
                            <source src={vids.src} type={vids.type}/>
                        </video>)
                })}
                />
        </div>
    )
};

export default Videos;
